import {
  Container,
  FormControl,
  Grid,
  makeStyles,
  NativeSelect,
} from "@material-ui/core";
import React, { useState } from "react";

const useStyles = makeStyles((theme) => ({
  root: {
    display: "block",
    height: theme.spacing(10),
    position: "absolute",
    width: "100%",
    left: "50%",
    bottom: "0",
    transform: "translate(-50%,50%)",
  },
  homeToolContainer: {
    backgroundColor: theme.palette.common.white,
    borderRadius: "5px",
    zIndex: "2",
    boxShadow: "0 0 10px rgb(0 0 0 / 30%)",
  },
}));

export default function HomeTool() {
  const classes = useStyles();
  const [state, setState] = useState({
    age: "",
  });

  const handleChange = (event) => {
    const name = event.target.name;
    setState({
      ...state,
      [name]: event.target.value,
    });
  };

  return (
    <Container id="homeTool" className={classes.root} maxWidth="md">
      <Grid container className={HomeToolContainer}>
        <div className={classes.selectFilm}>
          <FormControl>
            <NativeSelect value={state.age} name="age" onChange={handleChange}>
              <option value="" disabled>
                Phim
              </option>
              <option value={10}>Ten</option>
              <option value={20}>Twenty</option>
              <option value={30}>Thirty</option>
            </NativeSelect>
          </FormControl>
        </div>
        <div className={classes.selectCinema}></div>
        <div className={classes.selectDate}></div>
        <div className={classes.selectSession}></div>
        <div className={classes.buyContainer}></div>
      </Grid>
    </Container>
  );
}
